import React from "react";

function Modal({closeModal}){
    return(
        <div className="mr-[400px] absolute">
            <div className="">
                <button onClick={() => closeModal(false)} className="title"> X </button>
                <div className="body">OLLE</div>
                <div className="footer"></div>
            </div>
        </div>
    )

}

export default Modal;
